import React from "react";
import Fish from "./Fish";

class Order extends React.Component {
  render() {
    return;
    <ul className="fishes">
      {Object.keys(this.props.fishesDetails).map(fish => (
        <Fish key={fish} fishDetails={this.props.fishesDetails[fish]} />
      ))}
    </ul>;
  }
}

export default Order;
